import Link from "next/link";

const MyApp = ({ Component, pageProps }) => {
  return (
    <>
      <a href="/">Home</a>
      <a href="/about">About</a>
      <Component {...pageProps} />
      <footer>Jon Meyers was here!</footer>
    </>
  );
};

export default MyApp;
